import React from 'react';
import {Link} from 'react-router-dom';
import '../css/Login.css';

function Login() {
    return (
        <div>
            <h4>시작페이지</h4>
            <h5>째그만 이모티콘 그림</h5>
            <h3> 다이어리 이름 </h3>

            <h5>아이디 입력</h5>
            <h5>비번 입력</h5>
            <h5>로그인 버튼</h5>
            <h5><Link to='/signup'>회원가입 버튼</Link></h5>

        </div>
    )
}

export default Login;
